function notify(){var r=this;r.messages={200:"Sucesso!",403:"Parece que você não tem autorização para fazer isso!",404:"Erro 404: Não encontrado!",500:"Erro interno no servidor!"},r.success=function(r,o){r?toastr.success(r):toastr.success(o)},r.error=function(r,o){r?toastr.error(r):toastr.error(o)},r.warning=function(r,o){r?toastr.warning(r):toastr.warning(o)},r.showValidationErrors=function(o){for(var a in o)r.error(o[a],"Houve um erro desconhecido!")},r.errorFromResponse=function(o,a){switch(a.status){case 200:case 403:r.warning(a.data.message?messages[a.status]:"Parece que você não tem autorização para fazer isso!");break;case 422:for(var e in a.data)toastr.error(a.data[e]);break;default:toastr.error(a.data.message?a.data.message:"Um erro desconhecido ocorreu!","Erro ".concat(a.status))}}}angular.module("hermes_app").service("notify",notify);